      background-color: #111826;
      text-align: center;
      padding: 50px;
    }
    .container {
      background-color: #1f2936;
      padding: 20px;
      border-radius: 10px;
      max-width: 600px;
      margin: 0 auto;
    }
    h1 {
      color: #FFFFFF;
      font-size: 2.25rem;
      line-height: 2.5rem;
      background: radial-gradient(circle, #e9ff90, #cf0 40%);
      -webkit-background-clip: text;
      -webkit-text-fill-color: transparent;
    }
    p {
      font-size: 18px;
      color: #FFFFFF;
    }
    .button {
      background: radial-gradient(circle, #e9ff90, #cf0 40%);
      color: #000;
      border: none;
      font-size: 16px;
      padding: 12px 25px 14px;
      border-radius: 8px;
      transition: background .3s ease;
      text-decoration: none;
      margin: 30px auto auto auto;
      font-weight: 500;
      width: fit-content;
      display: block;
    }
    .button:hover {
      background-color: #cc0000;
    }
    img {
      width: 40px;
    }
  </style>
</head>
